$(function(){$("#fileupload").fileupload();$("#fileupload").fileupload("option","redirect",window.location.href.replace(/\/[^\/]*$/,"/cors/result.html?%s"));if(window.location.hostname==="blueimp.github.com"){$("#fileupload").fileupload("option",{url:"//jquery-file-upload.appspot.com/",maxFileSize:5000000,acceptFileTypes:/(\.|\/)(gif|jpe?g|png)$/i,process:[{action:"load",fileTypes:/^image\/(gif|jpeg|png)$/,maxFileSize:20000000},{action:"resize",maxWidth:1440,maxHeight:900},{action:"save"}]});if($.support.cors){$.ajax({url:"//jquery-file-upload.appspot.com/",type:"HEAD"}).fail(function(){$('<span class="alert alert-error"/>').text("Upload server currently unavailable - "+new Date()).appendTo("#fileupload")})}}else{$("#fileupload").each(function(){var a=this;$.getJSON(this.action,function(b){if(b&&b.length){$(a).fileupload("option","done").call(a,null,{result:b})}})})}});
